import React from "react";
import { NavLink } from "react-router-dom";
import "./NavBar.css";

export default function NavBar() {
  return (
    <div className="nav-bar">
      <NavLink to="/homeview" className="meme-book">
        Meme <br />
        <span
          style={{
            color: "black",
            fontSize: "50px",
            textShadow: "0 0 2px white",
          }}
        >
          Book
        </span>
      </NavLink>
      {/* <img src="./images/upload.png" alt="upload" className="meme-upload"/> */}
      <button to="/homeview/upload" className="meme-upload"></button>
      <button to="/homeview/create" className="meme-create"></button>
      <button to="/homeview/profile" className="meme"></button>
    </div>
  );
}
